import styled from "styled-components";
import { useNavigate } from "react-router-dom";

const Section03Section = styled.section`
  padding: var(--padding-sec);

  & img {
    width: 3rem;
  }
`;

const Section03Text = styled.div`
  & h3 {
    color: var(--black-01);
    font-size: 4rem;
    font-weight: 700;
  }

  & p {
    color: var(--grey-01); /* 변수명 확인 */
    font-size: 2.4rem;
    font-weight: 600;
  }

  & input {
    border: none;
    outline: none;
    border-bottom: 3px solid var(--black-01);
    width: 80%;
    padding: 1.3rem;
    font-size: 2rem;
  }

  & input::placeholder {
    font-size: 2rem;
  }

  & button {
    border: none;
    background: none;
  }

  & button > i {
    font-size: 2rem;
  }
`;

const Section03TagWrapper = styled.div`
  position: relative;
  width: 41.9rem;
  height: 31.8rem;

  & > div {
    padding: 10px 20px;
    border-radius: var(--tag-radius, 30px 30px 0 30px);
    position: absolute;
    transform: translate(0, 0);
    box-shadow: 3px 13px 25.4px 0 rgba(0,0,0,0.15);
    display: flex;
    align-items: center;
    cursor: pointer;
    transition: all 0.3s ease-out;
    z-index: 1;
    width: var(--tag-width, 14.5rem);
    background: var(--tag-bg, var(--White-01));
    top: var(--tag-top, 0);
    left: var(--tag-left, 0);
  }

  & > div img {
    width: var(--img-width, 3.4rem);
    height: 3rem;
    display: flex;
    justify-content: center;
    align-items: center;
    transition: transform 0.3s ease;
  }

  & > div p {
    color: var(--p-color, var(--black-01));
    font-size: 2.4rem;
    font-weight: 600;
    margin-left: 0.7rem;
    margin-bottom: 0;
    transition: transform 0.3s ease;
  }

  & > div:hover {
    transform: scale(1.05) translateY(-3px);
    box-shadow: 5px 15px 30px 0 rgba(0,0,0,0.18);
  }

  & > div:hover img {
    transform: scale(1.1);
  }

  & > div:hover p {
    transform: translateX(2px);
  }
`;

const Tag01 = styled.div`
  --tag-bg: var(--sub-Color4);
  --tag-top: 7.55%;
  --tag-left: 20.53%;
  --tag-width: 14.5rem;
  --img-width: 4.2rem;
  --p-color: var(--White-01);
  --tag-radius: 30px 30px 0 30px;
`
const Tag02 = styled.div`
  --tag-bg: var(--White-01);
  --tag-top: 37.42%;
  --tag-left: 0%;
  --tag-width: 14.5rem;
  --img-width: 3.4rem;
  --p-color: var(--black-01);
  --tag-radius: 30px 30px 0 30px;
`
const Tag03 = styled.div`
  --tag-bg: var(--White-01);
  --tag-top: 74.21%;
  --tag-left: 8.83%;
  --tag-width: 12.5rem;
  --img-width: 3rem;
  --p-color: var(--black-01);
  --tag-radius: 30px 30px 0 30px;
`
const Tag04 = styled.div`
  --tag-bg: var(--black-02);
  --tag-top: 0%;
  --tag-left: 71.6%;
  --tag-width: 12.5rem;
  --img-width: 3rem;
  --p-color: var(--White-01);
  --tag-radius: 30px 30px 0 30px;
`
const Tag05 = styled.div`
  --tag-bg: var(--White-01);
  --tag-top: 24.21%;
  --tag-left: 58.3%;
  --tag-width: 17rem;
  --img-width: 2.5rem;
  --p-color: var(--black-01);
  --tag-radius: 30px 30px 0 30px;
`
const Tag06 = styled.div`
  --tag-bg: #29AE51;
  --tag-top: 54.09%;
  --tag-left: 52.51%;
  --tag-width: 13rem;
  --img-width: 2.5rem;
  --p-color: var(--White-01);
  --tag-radius: 45px 45px 0 45px;
`


;



function Section03() {
  return (
    <Section03Section>
      <div className="container d-flex">
        <div className="col-md-6">
          <Section03Text>
            <h3>지금 나에게 필요한건?</h3>
            <p className="mb-45">부평시장의 다양한 상점을 소개합니다!</p>
            <div className="input_wrapper d-flex">
              <input
                type="text"
                placeholder="국내산 한우 차돌박이를  검색해보세요!"
              />
              <button onClick={() => navigator("/market")}>
                <i className="xi-arrow-right"></i>
              </button>
            </div>
          </Section03Text>
        </div>
        <Section03TagWrapper className="col-md-6">
          <Tag01>
            <a href="assets/pages/market.html">
              <img src="assets/images/sec03_icon_fish.png" alt="" />
            </a>
            <p>생선</p>
          </Tag01>

          <Tag02>
            <img src="assets/images/sec03_icon_meat.png" alt="" />
            <p>고기</p>
          </Tag02>

          <Tag03>
            <img src="assets/images/sec03_icon_fruit.png" alt="" />
            <p>과일</p>
          </Tag03>

          <Tag04>
            <img src="assets/images/sec03_icon_clothes.png" alt="" />
            <p>의류</p>
          </Tag04>

          <Tag05>
            <img src="assets/images/sec03_icon_detergent.png" alt="" />
            <p>생활용품</p>
          </Tag05>

          <Tag06>
            <img src="assets/images/sec03_icon_vege.png" alt="" />
            <p>채소</p>
          </Tag06>
        </Section03TagWrapper>
      </div>
    </Section03Section>
  );
}

export default Section03;
